import React from "react"
import {Avatar, Card} from 'antd'
const UserProfile = () => {
    return (
            <Card
                actions={{}}
            >
                <Card.Meta 
                    avatar={<Avatar>JF</Avatar>}
                    title="Jellyfish"
                />
            </Card>
    );
}

export default UserProfile
